                  <Nav variant="pills" className="nav-pills mb-5 justify-content-center align-items-center" id="pills-tab">
                    <Nav.Item>
                      <Nav.Link eventKey="first"><b>Web</b></Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="second"><b>Mobile</b></Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="third"><b>Matériel</b></Nav.Link>
                    </Nav.Item>
                  </Nav>

                  <Tab.Content id="slideInUp" className={isVisible ? "animate__animated animate__slideInUp" : ""}>

                    <Tab.Pane eventKey="first">
                      <Row>
                      <div className="container">
                        <div className="row">
                          <div className="col-12">
                            <div className="CarousselP-bx wow zoomIn">
                              <Carousel responsive={responsive} className="projectS-slider">

                                {meterImages.map((image, index) => (
                                  <div className="item" key={index}>
                                    <img src={image.src} alt={image.alt} />
                                    <h5>{image.title}</h5>
                                  </div>
                                ))}

                              </Carousel>;
                            </div>
                          </div>
                        </div>
                      </div>
                      </Row>
                    </Tab.Pane>

                    <Tab.Pane eventKey="second">
                      <Row>
                      <div className="container">
                        <div className="row">
                          <div className="col-12">
                            <div className="CarousselP-bx wow zoomIn">
                              <Carousel responsive={responsive} className="projectS-slider">

                                {meterImages.map((image, index) => (
                                  <div className="item" key={index}>
                                    <img src={image.src} alt={image.alt} />
                                    <h5>{image.title}</h5>
                                  </div>
                                ))}

                              </Carousel>;
                            </div>
